import React from 'react';
import { Box, Typography } from '@mui/material';

function Tasks() {
  return (
    <Box sx={{ p: 3 }}>
      <Typography variant="h4">Tasks</Typography>
      <Typography>Tasks feature coming soon...</Typography>
    </Box>
  );
}

export default Tasks;
